def find_chm13_gene(search_gene_list):
    '''
    Find out the T2T-chm13 novel and GRCh38 issue genes 

    Parameters
    ----------

    Returns
    -------
    - res: `dict`
        res['Novel']: The T2T-CHM13 novel genes
        res['GRCh38']: The GRCh38 issue genes
    '''
    data=pd.DataFrame(chm13_dict)
    res={}
    res['Novel']=list(set(data.loc[data['Novel region']==1].index.tolist()) & set(search_gene_list))
    res['GRCh38']=list(set(data.loc[data['GRCh38 issue']==1].index.tolist()) & set(search_gene_list))
    print('Novel region:{}, GRch38 issue:{}'.format(len(res['Novel']),len(res['GRCh38'])))
    return res